import React from 'react';
import { NavLink, Link, withRouter, useHistory } from 'react-router-dom';
import { isAuthenticated, signout, brandSignout  } from './../../';
import './style.css';


function Header () {
    return (
        <header className="header">
            <Link to="/">
            <div className="logo_container">
                <strong className="logo">LogisTech</strong>
            </div>
            </Link>


            <div className="header_direita">
                <Link to="/login">
                <div className="login">
                    <span>Log in</span>
                </div>
                </Link>

                <Link>
                <div className="contato">
                    <span>Contact</span>
                </div>
                </Link>

                <Link to="/register">
                <div className="cadastro_empresa">
                    <span>Register</span>
                </div>
                </Link>

            </div>
        </header>
    );
}

export default Header;
